export default {
    namespaced: true,
    state: {       

        contragents: [],

    },
    getters: {


        contragent(state) {
            return state.contragent
        },


    },
    mutations: {

        ADD_ALL_CONTRAGENTS(state, payload){
            state.contragents.push(payload)
        },
        ADD_NEW_CONTRAGENTS(state, payload){
            state.contragents.push(payload)
        },
        removeContract(state, index) {
            state.contragents.splice(index, 1);
          }
    } 



}
